import React from "react";
import { ReactComponent as Logo } from "../images/logo-bonus.svg";

const Score = ({score}) => {
    return(
        <div className="head">
            <Logo className="logo"/>
            <div className="score">
                <p>SCORE</p>
                <span>{score}</span>
            </div>
        </div>
    )
}

export default Score;
